import React, { useState, useEffect, useRef } from 'react';
import { useToast } from './ToastProvider';
import '../styles/CodeEditor.css';
import Button from './Button';

function CodeEditor({ initialCode, lessonId, onChange }) {
  const defaultCode = `public class Main {
    public static void main(String[] args) {
        // Scrie codul tƒÉu aici
        System.out.println("Bine ai venit la JavaVerse!");
    }
}`;

  const [output, setOutput] = useState('');
  const [isRunning, setIsRunning] = useState(false);
  const [isEditorReady, setIsEditorReady] = useState(false);
  const [isEditorLoading, setIsEditorLoading] = useState(true);
  const [feedback, setFeedback] = useState('');
  const [showFeedback, setShowFeedback] = useState(false);
  const [isAnalyzing, setIsAnalyzing] = useState(false);
  const monacoRef = useRef(null);
  const editorRef = useRef(null);
  const lastInitialCodeRef = useRef(initialCode);
  const toast = useToast();

  // NU mai folosim state pentru code - totul se gestioneazƒÉ direct √Æn editor!

  // Ini»õializarea Monaco Editor
  useEffect(() => {
    let isMounted = true;
    
    const loadMonacoEditor = async () => {
      try {
        setIsEditorLoading(true);
        
        const monaco = await import('@monaco-editor/react');
        
        if (isMounted) {
          monacoRef.current = monaco;
          setIsEditorLoading(false);
          setIsEditorReady(true);
        }
      } catch (error) {
        console.error('Eroare la √ÆncƒÉrcarea Monaco Editor:', error);
        if (isMounted) {
          setIsEditorLoading(false);
          toast.error('Nu s-a putut √ÆncƒÉrca editorul de cod.');
        }
      }
    };

    loadMonacoEditor();
    
    return () => {
      isMounted = false;
      if (editorRef.current) {
        editorRef.current.dispose();
      }
    };
  }, [toast]);

  // Actualizare pentru schimbarea exemplelor
  useEffect(() => {
    if (initialCode && 
        initialCode !== lastInitialCodeRef.current && 
        editorRef.current && 
        isEditorReady) {
      
      console.log('Actualizez editorul cu exemplu nou');
      editorRef.current.setValue(initialCode);
      lastInitialCodeRef.current = initialCode;
    }
  }, [initialCode, isEditorReady]);

  const handleEditorDidMount = (editor) => {
    editorRef.current = editor;
    setIsEditorReady(true);
    setIsEditorLoading(false);
    
    // SetƒÉm codul ini»õial
    const codeToSet = initialCode || defaultCode;
    editor.setValue(codeToSet);
    lastInitialCodeRef.current = initialCode;
    
    // FocalizƒÉm editorul
    editor.focus();
    
    console.log('Monaco Editor s-a √ÆncƒÉrcat cu succes');
  };

  // Func»õie pentru a ob»õine codul curent din editor
  const getCurrentCode = () => {
    if (editorRef.current) {
      return editorRef.current.getValue();
    }
    return initialCode || defaultCode;
  };

  const handleRunCode = async () => {
    if (!isEditorReady) {
      toast.warning('Editorul nu este pregƒÉtit √ÆncƒÉ. Te rugƒÉm sƒÉ a»ôtep»õi.');
      return;
    }

    // Ob»õinem codul direct din editor, NU din state
    const codeToRun = getCurrentCode();
    
    setIsRunning(true);
    setOutput('Se executƒÉ codul...');

    try {
      const response = await fetch('http://localhost:5000/api/execute-code', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
          'Authorization': `Bearer ${sessionStorage.getItem('authToken')}`
        },
        body: JSON.stringify({
          code: codeToRun
        }),
      });

      const data = await response.json();
      
      if (data.error) {
        setOutput(`Eroare: ${data.error}`);
        toast.error('A apƒÉrut o eroare la executarea codului.');
      } else {
        setOutput(data.output);
        if (data.statusCode === 200) {
          toast.success('Codul a fost executat cu succes!');
        }
      }
    } catch (error) {
      console.error('Error running code:', error);
      handleRunCodeSimulation(codeToRun);
    } finally {
      setIsRunning(false);
    }
  };

  // Simulare a rulƒÉrii codului
  const handleRunCodeSimulation = (codeToRun) => {
    setIsRunning(true);
    setOutput('Se executƒÉ codul...');

    setTimeout(() => {
      if (codeToRun.includes('System.out.println')) {
        const outputMatches = codeToRun.match(/System\.out\.println\("(.*)"\)/g);
        if (outputMatches && outputMatches.length > 0) {
          const outputs = outputMatches.map(match => {
            const content = match.match(/System\.out\.println\("(.*)"\)/);
            return content && content[1] ? content[1] : '';
          });
          setOutput(outputs.join('\n'));
          toast.success('Codul a fost executat cu succes!');
        } else {
          setOutput('Bine ai venit la JavaVerse!');
          toast.success('Codul a fost executat cu succes!');
        }
      } else if (codeToRun.includes('error') || codeToRun.includes('Error')) {
        setOutput('Exception in thread "main" java.lang.RuntimeException: Simulare eroare\n   at Main.main(Main.java:4)');
        toast.error('Codul con»õine erori de compilare.');
      } else {
        setOutput('Execu»õie reu»ôitƒÉ! (fƒÉrƒÉ output)');
        toast.success('Codul a fost executat cu succes!');
      }
      setIsRunning(false);
    }, 1500);
  };

  const handleGetFeedback = async () => {
    const codeToAnalyze = getCurrentCode();
    
    setIsAnalyzing(true);
    setFeedback('Se analizeazƒÉ codul...');
    setShowFeedback(true);

    try {
      const response = await fetch('http://localhost:5000/api/analyze-code', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
          'Authorization': `Bearer ${sessionStorage.getItem('authToken')}`
        },
        body: JSON.stringify({
          code: codeToAnalyze,
          lessonId: lessonId
        }),
      });

      const data = await response.json();
      
      if (data.success) {
        setFeedback(data.feedback);
        toast.success('Feedback generat cu succes!');
      } else {
        setFeedback('Nu am putut genera feedback pentru acest cod.');
        toast.error('Eroare la generarea feedback-ului.');
      }
    } catch (error) {
      console.error('Error analyzing code:', error);
      
      setTimeout(() => {
        const simulatedFeedback = `# Analiza codului tƒÉu

Salut! IatƒÉ feedback-ul meu pentru codul tƒÉu Java:

## Puncte forte:
- Structura de bazƒÉ a programului este corectƒÉ
- Folose»ôti corect metoda System.out.println()

## Sugestii de √ÆmbunƒÉtƒÉ»õire:
- AdaugƒÉ comentarii pentru a explica ce face codul tƒÉu
- ConsiderƒÉ folosirea mai multor metode pentru a separa logica

ContinuƒÉ sƒÉ exersezi »ôi sƒÉ √ÆmbunƒÉtƒÉ»õe»ôti codul!`;
        
        setFeedback(simulatedFeedback);
        setIsAnalyzing(false);
        toast.success('Feedback generat cu succes!');
      }, 2000);
    } finally {
      setIsAnalyzing(false);
    }
  };

  const handleResetCode = () => {
    if (window.confirm('Sigur dore»ôti sƒÉ resetezi codul? Toate modificƒÉrile vor fi pierdute.')) {
      const codeToReset = initialCode || defaultCode;
      if (editorRef.current) {
        editorRef.current.setValue(codeToReset);
      }
      toast.info('Codul a fost resetat.');
    }
  };

  return (
    <div className="code-editor-container">
      <div className="editor-header">
        <h3>Editor de cod Java</h3>
        <div className="editor-actions">
          <Button 
            variant="secondary"
            size="small"
            onClick={handleResetCode}
            icon="üîÑ"
            iconPosition="left"
          >
            ReseteazƒÉ
          </Button>
          <Button 
            variant="info"
            size="small"
            onClick={handleGetFeedback}
            disabled={isAnalyzing || !isEditorReady}
            icon={isAnalyzing ? "‚è≥" : "ü§ñ"}
            iconPosition="left"
          >
            {isAnalyzing ? 'Se analizeazƒÉ...' : 'Ob»õine feedback AI'}
          </Button>
          <Button 
            variant="primary"
            size="small"
            onClick={handleRunCode}
            disabled={isRunning || !isEditorReady}
            icon={isRunning ? "‚è≥" : "‚ñ∂Ô∏è"}
            iconPosition="left"
          >
            {isRunning ? 'Se executƒÉ...' : 'RuleazƒÉ codul'}
          </Button>
        </div>
      </div>

      <div className="editor-wrapper">
        {isEditorLoading ? (
          <div className="editor-loading">
            <div className="loading-spinner"></div>
            <p>Se √ÆncarcƒÉ editorul...</p>
          </div>
        ) : monacoRef.current ? (
          <monacoRef.current.default
            height="400px"
            language="java"
            theme="vs-dark"
            defaultValue={initialCode || defaultCode}
            onMount={handleEditorDidMount}
            options={{
              minimap: { enabled: false },
              fontSize: 14,
              scrollBeyondLastLine: false,
              automaticLayout: true,
              tabSize: 2,
              folding: true,
              lineNumbers: 'on',
              renderLineHighlight: 'all',
              wordWrap: 'on',
              formatOnPaste: true,
              formatOnType: true
            }}
